const ErrorCard = (props) => {

    return (
        <Box d="flex" className="bg-white rounded">
            <Box style={{ justifyContent: "center", alignItems: "center", margin: "75px 20px 75px 20px" }}>
                It looks like the user is private or doesn't have any photos :(
